import React from 'react';
import { Route, Redirect, Routes } from 'react-router-dom';

const PrivateRoute = (children, ...rest) => {
    console.log("private")
    return 
    (
        <div>
            <Routes>
                <Route {...rest}>{children}</Route>
            </Routes>
        </div>
    );
};

export default PrivateRoute;
